def stacktraceLinesPattern = /^[^\s].+((\n\sat.+)+)[\S\s]*/;
def lineNumberPattern = /:\d+\)/;
def unwantedLinePattern = /\nCaused by.+|\n\s+\..+/;
def stackTraceLinesMatcher = stacktraceLinesPattern.matcher(stacktrace.replaceAll(unwantedLinePattern, (s)->""));

if(stackTraceLinesMatcher.matches()) {
    def curatedLines = stackTraceLinesMatcher.group(1).replaceAll(lineNumberPattern, (s)->")");
    def stacktracePattern = exceptionType + curatedLines;
    emit(String.valueOf(stacktracePattern.hashCode()).encodeBase64());
}

if(doc.containsKey("span.name") && !doc["span.name"].isEmpty()) {
  emit("[Span] - " + $("span.name", ""));
} else if (doc.containsKey("transaction.name") && !doc["transaction.name"].isEmpty()) {
  emit("[Span] - " + $("transaction.name", ""));
} else if (doc.containsKey("message")) {
  if (doc.containsKey("event_name") && !doc["event_name"].isEmpty()) {
    emit("[Log] - " + $("event_name", ""));
  } else if (doc.containsKey("otel.event.name") && !doc["otel.event.name"].isEmpty()) {
    emit("[Log] - " + $("otel.event.name", ""));
  } else if (doc.containsKey("labels.otel_event_name") && !doc["labels.otel_event_name"].isEmpty()) {
    emit("[Log] - " + $("labels.otel_event_name", ""));
  } else {
    emit("[Log] - " + $("message", ""));
  }
}

if(doc.containsKey("os.version")) {
    emit($("os.version", ""));
} else if(doc.containsKey("host.os.version")) {
    emit($("host.os.version", ""));
}

if(doc.containsKey("exception.message")) {
