} else if(doc.containsKey("transaction.name")) {
  emit($("transaction.name", ""));
}

if(doc.containsKey("duration") && !doc["duration"].isEmpty()) {
  emit($("duration", 0));
} else if(doc.containsKey("transaction.duration.us") && !doc["transaction.duration.us"].isEmpty()) {
  emit($("transaction.duration.us", 0) * 1000);
} else if(doc.containsKey("span.duration.us") && !doc["span.duration.us"].isEmpty()) {
  emit($("span.duration.us", 0) * 1000);
}

if(doc.containsKey("exception.stacktrace")) {
  // EDOT Collector field
  if(!doc["exception.stacktrace"].isEmpty()) {
    emit($("exception.stacktrace", ""));
  }
  return;
}
if(doc.containsKey("error.stack_trace") && !doc["error.stack_trace"].isEmpty()) {
  // APM Server fallback to ECS field for when the exception cannot be parsed
  emit($("error.stack_trace", ""));
  return;
}
def source = params['_source'];
if(source.error?.exception == null) {
  return;
}
// APM Server exception field
def exceptions = source.error.exception;
if(exceptions.size() == 0) {
  return;
}
def newline = (char)0x0a;
def tabspace = (char)0x09;
def result = new StringBuilder();
for(int i = 0; i < exceptions.size(); i++) {
  def ex = exceptions[i];
  if(i == 0) {
    if(ex.type != null) {
      result.append(ex.type);
      result.append(": ");
    }
    result.append(ex.message);
  } else {
    result.append(newline);
    result.append("Caused by: ");
    result.append(ex.message);
  }
  def frames = ex.stacktrace;
  if(frames == null || frames.size() == 0) {
    continue;
  }
  for(int j = 0; j < frames.size(); j++) {
    def frame = frames[j];
    result.append(newline);
    result.append(tabspace);
    result.append("at ");
    result.append(frame.classname);
    result.append(".");
    result.append(frame.function);
    result.append("(");
    result.append(frame.filename);
    if(frame.line?.number != null) {
      result.append(":");
      result.append(frame.line.number);
    }
    result.append(")")
  }
}
emit(result.toString());

